// src/components/Home.js
import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="text-center">
      <h1 className="mb-4">Pradhan Mantri Ujjwala Yojana</h1>
      <Link to="/apply" className="btn btn-primary m-2">Apply for Scheme</Link>
      <Link to="/admin" className="btn btn-secondary m-2">Admin Login</Link>
    </div>
  );
};

export default Home;
